import { useState, useEffect } from 'react'
import Blog from './components/Blog'
import loginService from './services/login'
import blogService from './services/blogs'
import Notification from './components/Notification'
import './index.css'

const App = () => {
  const [blogs, setBlogs] = useState([])
  const [notificationMessage, setNotificationMessage] = useState(null)
  const [notificationType, setNotificationType] = useState(null)
  const [username, setUsername] = useState('')
  const [password, setPassword] = useState('')
  const [user, setUser] = useState(null)
  const [title, setTitle] = useState('')
  const [author, setAuthor] = useState('')
  const [url, setUrl] = useState('')

  useEffect(() => {
    blogService.getAll().then(blogs =>
      setBlogs( blogs )
    )  
  }, [])

  useEffect(() => {
    const loggedUserJSON = window.localStorage.getItem('loggedUser')
    if (loggedUserJSON) {
      const user = JSON.parse(loggedUserJSON)
      setUser(user)
      blogService.setToken(user.token)
    }
  }, [])


  const handleLogin = async (event) => {
    event.preventDefault()
    try {
      const user = await loginService.login({ username, password, })
      window.localStorage.setItem('loggedUser', JSON.stringify(user))
      blogService.setToken(user.token)
      setUser(user)
      setUsername('')
      setPassword('')
      setNotificationType('info')
      setNotificationMessage('login succesful')
      setTimeout(() => {
        setNotificationMessage(null)}, 5000)
      } catch (exception) {
      setNotificationType('error')
      setNotificationMessage('wrong credentials')
      setTimeout(() => {
        setNotificationMessage(null)}, 5000)
      }
  }

  const loginForm = () => {
    return (
      <form onSubmit={handleLogin}>
        <div>
          username
            <input
            type="text"
            value={username}
            name="Username"
            onChange={({ target }) => setUsername(target.value)}
            />
        </div>
        <div>
          password
            <input
            type="text"
            value={password}
            name="Password"
            onChange={({ target }) => setPassword(target.value)}
            />
        </div>
        <button type="submit">login</button>
      </form>
    )
  }

  const handleLogout = () => {
    window.localStorage.removeItem('loggedUser')
    setUser(null)
  }

  const handleNewBlog = async (event) => {
    event.preventDefault()

    try {
      const newBlog = await blogService.createNew({ title, author, url })
      setNotificationType('info')
      setNotificationMessage(`new blog ${title} by ${author} added`)
      setTimeout(() => {
        setNotificationMessage(null)}, 5000
      )
      setTitle('')
      setAuthor('')
      setUrl('')
      let blogsList = [...blogs]
      blogsList.push(newBlog)
      setBlogs(blogsList)
    } catch (exception) {
      setNotificationType('error')
      setNotificationMessage('error adding blog')
      setTimeout(() => {setNotificationMessage(null)}, 5000)
    }

  } 

  const blogForm = () => {
    return (    
      <form onSubmit={handleNewBlog}>
        <div>
          title:
            <input
            type="text"
            value={title}
            name="Title"
            onChange={({ target }) => setTitle(target.value)}
            />
        </div>
        <div>
          author:
            <input
            type="text"
            value={author}
            name="Author"
            onChange={({ target }) => setAuthor(target.value)}
            />
        </div>
        <div>
          url:
            <input
            type="text"
            value={url}
            name="Url"
            onChange={({ target }) => setUrl(target.value)}
            />
        </div>
        <button type="submit">create</button> 
      </form>
    )
  }

  if (user === null) {
    return (
      <div>
        <h2>Log in to the application</h2>
        <Notification message={notificationMessage} type={notificationType} />
        {loginForm()}
      </div>
    )
  }

  return (
    <div>
      <h2>blogs</h2>

      <Notification message={notificationMessage} type={notificationType} />

      <div className='loggedUserInfo'>
          {user.name} logged in 
          <button onClick={handleLogout}>Logout</button>
      </div>

      <div className="blogForm">
        <h2>create new</h2>
        {blogForm()}
      </div>

      <div className="blogList">
        {blogs
          .filter(blog => blog.user.username === user.username)
          .map(blog => <Blog key={blog.id} blog={blog}/>)
        }
      </div>
    </div>
  )
}

export default App
